import React from "react";
import { useSelector } from "react-redux";

export default Alert = () => {
  const alerts = useSelector((state) => state.alert);

  alerts !== null &&
  alerts.length > 0 &&
  alerts.map(alert => (
    <div key={alert.id} className={`alert alert-${alert.alertType}`}>
      {alert.msg}
    </div>
  ));

 
}
